import React from 'react'

const top = {
    display: 'flex',
    marginTop: '100px',
};

const mainText = {
    flex: 2,
};

const image = {
    opacity: .1,
    flex: 1,
};

const bottom = {
    marginTop: '50px'
};

const box1 = {
    backgroundColor: 'bisque',
};

const box2 = {
    backgroundColor: 'bisque',
};

const buttonStyle = {
    borderRadius: '18px',
    backgroundColor: 'wheat',
    borderStyle: 'dashed',
};

const inputStyle = {
    borderRadius: '18px',
    backgroundColor: 'wheat',
    borderStyle: 'dashed',
    marginRight: '25px'
};

const Content = () => {
  return (
    <div>
        <div style={top}>
        <div style={mainText}>More than just shortner links</div>
        <div style={image}>
            <img src='https://www.shutterstock.com/image-vector/girl-working-on-computer-evening-260nw-773613916.jpg'/>
        </div>
        </div>

        <div style={bottom}>
            <div style={box1}>
                <input style={inputStyle} type='url' />
                <button style={buttonStyle}> Shorten</button>
            </div>
            <div style={box2}>box 2</div>
        </div>
    </div>
  )
}

export default Content;
